		Dataset Details


中文校阅数据集，其中有通用校阅数据27w条、法律垂直领域校阅数据35w条，总上下文不超过512。





		Dataset Description


一部分收集自pycorrect并进行一定的重复度清洗，非常感谢
另一部分则来自一些书籍和法律文书。
